import axios from "axios";

const urlAllPlanets = 'http://localhost:8080/planets';

export const fetchData = async() => {
    try {
        const response = await axios.get(urlAllPlanets);
        console.log(response); 
    }
    catch (err) {
        console.error(err);
    }
}
